import React from "react";
import Content from "./Content";
import Kabinet from "./testRoute";
import './styles/App.css';
import {
  BrowserRouter as Router,
  Routes,
  Switch,
  Route,
  Link,
} from 'react-router-dom';


function App() {
  return (
   <div >


   <div className="header">
    <h1>Сars_sale - продажа авто с пробегом</h1>
    <a  href="/main" ><button className="cabinet" >Личный кабинет</button></a>
    <button className="cabinet" >Регистрация</button>
   </div>

   <div className="cont">
   <Routes>
        <Route path="/main" element={<Kabinet/>}>

        </Route>"
        <Route path="/" element={<Kabinet/>}>

        <Content/>
          </Route>


   <Content/>
   </Routes>
</div>

    </div>
  );
}

export default App;
